import React, { useState } from "react";
import {
    Card,
    CardHeader,
    CardBody,
    Container,
    Row,
    Col,
    Button,
    Input,
    Table,
} from "reactstrap";
import { useNavigate } from "react-router-dom";
import Header from "components/Headers/Header.js";

const MedicineTypes = () => {
    const navigate = useNavigate();
    const [searchTerm, setSearchTerm] = useState("");
    const [medicineTypes, setMedicineTypes] = useState([
        { id: 1, code: "ABC001", name: "Kháng sinh" },
        { id: 2, code: "ABC002", name: "Giảm đau" },
        { id: 3, code: "ABC003", name: "Kháng viêm" },
    ]);

    // Filter medicine types based on search term
    const filteredMedicineTypes = medicineTypes.filter(
        (type) =>
            type.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
            type.code.toLowerCase().includes(searchTerm.toLowerCase())
    );

    // Handle delete medicine type
    const handleDelete = (id) => {
        setMedicineTypes(medicineTypes.filter((type) => type.id !== id));
    };

    // Navigate to add medicine type page
    const handleAddMedicineType = () => {
        navigate("/admin/add-medicine-types");
    };

    return (
        <>
            <Header />
            <Container className="mt--7" fluid>
                <Row>
                    <Col>
                        <Card className="shadow">
                            <CardHeader className="border-0">
                                <Row className="align-items-center">
                                    <Col xs="8">
                                        <h3 className="mb-0">Danh Sách Loại Thuốc</h3>
                                    </Col>
                                    <Col className="text-right" xs="4">
                                        <Button
                                            color="primary"
                                            onClick={handleAddMedicineType}
                                            size="sm"
                                        >
                                            Thêm Loại Thuốc
                                        </Button>
                                    </Col>
                                </Row>
                                <Input
                                    type="text"
                                    placeholder="Tìm kiếm loại thuốc"
                                    value={searchTerm}
                                    onChange={(e) => setSearchTerm(e.target.value)}
                                    className="mt-3"
                                    style={{ marginTop: "10px" }}
                                />
                            </CardHeader>
                            <CardBody>
                                <Table className="align-items-center table-flush" responsive>
                                    <thead className="thead-light">
                                        <tr>
                                            <th scope="col">STT</th>
                                            <th scope="col">Mã Loại Thuốc</th>
                                            <th scope="col">Tên Loại Thuốc</th>
                                            <th scope="col">Hành Động</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {filteredMedicineTypes.map((type, index) => (
                                            <tr key={type.id}>
                                                <td>{index + 1}</td>
                                                <td>{type.code}</td>
                                                <td>{type.name}</td>
                                                <td>
                                                    <Button
                                                        color="info"
                                                        size="sm"
                                                        className="mr-2"
                                                    >
                                                        Sửa
                                                    </Button>
                                                    <Button
                                                        color="danger"
                                                        size="sm"
                                                        onClick={() => handleDelete(type.id)}
                                                    >
                                                        Xoá
                                                    </Button>
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </Table>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </>
    );
};

export default MedicineTypes;
